import React from "react";
import { pages } from "../constant/pages";

const Sidebar = () => {
  return (
    <section className="place-self-start z-10 relative rounded-l bg-indigo  -900">
      <nav>
        <ul>
          {pages.map((item) => {
            return (
              <li>
                <div className=" h-[100px] w-[100px] rounded-l">
                  {item.route}{" "}
                </div>
              </li>
            );
          })}
        </ul>
      </nav>
    </section>
  );
};

export default Sidebar;
